#刘力菲[超话]# 🔥#中泰仙女刘力菲# 
【春日大作战】
春天的脚步悄然而至，大地一片生机勃勃。在这美好的季节里，八位好友组织了一次春日大作战，一同能够放松心情，感受春天的美好。

🎫比赛规则🎫
比赛分为三天进行，第一日采取八进四赛制，首日排名前四者可直接进入第二日比拼。后四名则可选择缴纳100r复活金加入次日比拼。第二日排名前两位将进入第三日的终极决战，不可复活。

💰奖池分配💰
1️⃣若四家均选择复活，最终总额获胜第一名得200r、第二名100r、三四名各50r。
2️⃣若三家选择复活，最终总额获胜第一名得150r、第二名100r、第三名50r。
3️⃣若两家选择复活，最终总额获胜第一名得150r、第二名50r。
4️⃣若仅一家复活，总额第一名独得100r。

🎯活动时间🎯
初赛：4.4日18-24点
决赛：4.5日18-24点
终极决战：4.6日 18-24点

